  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides an introduction to
  the Canada Goose Hunting Program at Ottawa NWR. Federal and state regulations are
  summarized, and hunter selection and permit conditions are discussed. Specifics
  of the hunt are also covered including shooting days and hours, blind spacing, blind
  selection, hunter distribution, hunter success, and harvest age and sex ratios.
  Recommendations are provided for future hunts. Hunting maps, hunter demographics,
  and harvest tables are also included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
